// msg1 is the answer sent to serial port
// msg2 interprets the received character for the log file
// msg3 when ready is the complete frame to be analized.
// msg4 Sent message between STX and ETX.
// msg5 Sent trigger sending message to the cloud, after EOT.

var frame=global.get('frame')  // Buffer for the current frame
var chksum=global.get('chksum');  // Check sum of frame
var calchksum=global.get('calchksum'); // Calculate checksum
var framechksum = global.get('framechksum'); // We store here the frame chcksum
var numchars = context.get('numchars');
var cks = context.get('cks');
var tracechars = global.get('tracechars');

var msg1 = {payload: [0]};
var msg2 = {payload:""};
var msg3 = {payload:""};
var msg4 = {payload:""};
var msg5 = {payload:""};


if (calchksum !== false) {
    global.set('chksum', chksum + msg.payload[0]);
    tracechars.push(msg.payload[0]);
    global.set('tracechars',tracechars);
    if (global.get('chksum') > 255) {
        global.set('chksum', global.get('chksum') - 256);
    }
} else {
    if (context.get('finished') === true) {
        if (numchars <= 2) {
            framechksum = framechksum + String.fromCharCode(msg.payload[0]);
            global.set('framechksum',framechksum);
            numchars++;
            context.set('numchars',numchars)
            if (numchars >= 2) {
                context.set('finished',false);
            }
        }
    }

}

switch(msg.payload[0]) {
    case 2:
        global.set('chksum',false);         // Check sum of frame
        global.set('calchksum',1);          // Flag to Calculate checksum
        global.set('frame', "");            // Buffer for the current frame
        global.set('framechksum',"");       // We store here the frame chcksum
        context.set('numchars',0);          // Number of characters of received frame checksum
        context.set('finished',false);      // Has finished summing chksum
        context.set('cks',"");              // String version of calculated checksum
        msg1 = null;
        msg2.payload = "<STX>";
        msg3 = null;
        msg4 = null;
        msg5 = null;
        break;
    case 3:
        global.set('calchksum',false);
        context.set('finished',true);
        msg1 = null;
        msg2.payload = "<ETX>";
        msg4.payload = frame.toString();
        frame = frame + msg.payload.toString();
        global.set('frame', frame);

        msg3 = null;
        msg5 = null;
        break;
    case 4:
        msg1.payload = new Buffer([0x04]);
        msg2.payload = "<EOT>";
        msg3 = null;
        msg4 = null;
        msg5.payload = "<EOT>";
        break;
    case 5:
        global.set("frame","");
        msg1.payload = new Buffer([0x06]);
        msg2.payload = "<ENQ>";
        msg3 = null;
        msg4 = null;
        msg5 = null;
        break;
    case 6:
        msg1 = null;
        msg2.payload = "<ACK>";
        msg3 = null;
        msg4 = null;
        msg5 = null;
        break;
    case 10:
        cks = chksum.toString(16).padStart(2, '0').toUpperCase();
        context.set('cks',cks);
        if (cks == framechksum) {
            msg1.payload = new Buffer([0x06]);  // Checksum OK = ACK
            msg3.payload = frame + "\n";
        } else {
            msg1.payload = new Buffer([0x15]);  // Checksum not OK = NAK
            msg3.payload = null;
        }

        msg4 = null;
        msg5 = null;
        msg2.payload = "<LF>";
        break;
    case 13:
        msg1 = null;
        msg2.payload = "<CR>";
        frame = frame + msg.payload.toString();
        global.set('frame', frame);
        msg3 = null;
        msg4 = null;
        msg5 = null;
        break;
    case 21:
        msg1 = null;
        msg2.payload = "<NAK>";
        msg3 = null;
        msg4 = null;
        msg5 = null;
        break;
    case 23:
        msg1 = null;
        global.set('calchksum',false);
        context.set('finished',true);
        msg2.payload = "<ETB>";
        frame = frame + msg.payload.toString();
        global.set('frame', frame);
        msg3 = null;
        msg4 = null;
        msg5 = null;
        break;
    default:
        msg1 = null;
        msg2.payload = msg.payload.toString();
        frame = frame + msg.payload.toString();
        global.set('frame', frame);
        msg3 = null;
        msg4 = null;
        msg5 = null;
}
msg2.topic = "Rx: ";
return [msg1,msg2,msg3,msg4,msg5];

